import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";
import {Home} from "./pages/Home";
import { Pricing } from "./pages/Pricing";
import { About } from "./pages/About";
import { Services } from "./pages/Services";
import { IndividualBlog } from "./pages/IndividualBlog";
import { AllBlogs } from "./pages/AllBlogs";
import { ProductOne } from "./pages/Products/ProductOne";
import { ProductTwo } from "./pages/Products/ProductTwo";
import { ProductThree } from "./pages/Products/ProductThree";
import { ProductFour } from "./pages/Products/ProductFour";
import { ProductFive } from "./pages/Products/ProductFive";
import { Login } from "./pages/Auth/login";
import { SignUp } from "./pages/Auth/signup";
import { ResetPassword_One } from "./pages/Auth/resetpassword_one";
import { ResetPassword_Two } from "./pages/Auth/resetpassword_two";
import { OTP } from "./pages/Auth/otp";
import { Congratulations } from "./pages/Auth/congrejulations";
import { DashboardLayout } from "./pages/Dashboard/DashboardLayout";


function App() {

  const router = createBrowserRouter([
    {
      path: "/",
      element: 
        <Home />
    },
    {
      path: "/pricing",
      element: 
        <Pricing />
    },
    {
      path: "/about",
      element: 
       <About />
    },
    {
      path: "/services",
      element: 
       <Services />
    },
    {
      path: "/individualblog",
      element: 
       <IndividualBlog />
    },
    {
      path: "/allblogs",
      element: 
       <AllBlogs />
    },
    {
      path: "/productone",
      element: 
       <ProductOne />
    },
    {
      path: "/producttwo",
      element: 
       <ProductTwo />
    },
    {
      path: "/productthree",
      element: 
       <ProductThree />
    },
    {
      path: "/productfour",
      element: 
       <ProductFour />
    },
    {
      path: "/productfive",
      element: 
       <ProductFive />
    },
    {
      path: "/login",
      element: 
       <Login />
    },
    {
      path: "/signup",
      element: 
       <SignUp />
    },
    {
      path: "/resetpassword-one",
      element: 
       <ResetPassword_One />
    },
    {
      path: "/otp",
      element: 
       <OTP />
    },
    {
      path: "/resetpassword-two",
      element: 
       <ResetPassword_Two />
    },
    {
      path: "/congratulations",
      element: 
       <Congratulations />
    },
    {
      path: ':id/dashboard',
      element: <DashboardLayout />,
      children: [
        { path: '/home', element: <Home /> },
        { path: '/generate', element: <Page2 /> },
      ],
    },

  ]);
  return  <RouterProvider router={router} />
}

export default App;
